import { Component } from "react";
import "./card.styles.css"

class Card extends Component{
    render(){
        const { name, image, email,lat, long } = this.props;
        return(
        <div className="card-container shadow-1">
            <div className="">
                <h1>{name}</h1>
                <img src={image} alt="" />
                <h3>{email}</h3>
            </div>
            <div className="br3 bg-light-green shadow-1 ba-black">
            <h4>Geographic Location:</h4>
                <ul>
                    <li>Lat: {lat}</li>
                    <li>Long: {long}</li>
                </ul>
            </div>

        </div>
        )
    }
}
export default Card;
